/*!40000 ALTER TABLE `review_detail` DISABLE KEYS */;
INSERT INTO `review_detail` VALUES (1,1,1,'I prefer more compartments','I prefer more compartments. If you don\'t mind putting everything in one space, it\'s fine. Good for the gym.','Chi',NULL),(2,2,1,'I use it a lot ','It\'s a good size and I use it a lot. My only issue with it was I wanted the handles to be longer so I can wear it on my back.','Filiberto',NULL),(3,3,1,'I\'ve had this thing for really long','I\'ve had this thing for a really long time and it barely shows any signs of wear and tear. It\'s really big, too! I\'ve taken it on day trips as well as short vacations and usually have no trouble finding room for my stuff.','Herb',NULL),(4,4,1,'Decent bag','Decent bag. I keep my stuff in it for work and the gym. It\'s nice and roomy. I wish it had a more sophisticated design, though. Kinda looks like it\'s for kids.','Craig',NULL),(5,5,1,'Screwed up my back','I can\'t believe they\'re claiming these straps are \"padded.\" Wearing this thing to class for a semester totally screwed up my back, and my shoulders would start to ache after a few minutes where the straps dug in.','Orville',NULL),(6,6,1,'Awesome bag','Awesome bag but I found it to be smaller than I thought. I haven\'t felt any additional strain on my back and I use it all day long for my job.','Marty',NULL),(7,7,1,'The back needs more padding','If the back had more padding I would recommend it for everyone. You can tell the material is strong and not cheap so it\'s definitely worth it.','Chase',NULL),(8,8,1,'I bought this backpack for my son','I bought this backpack for my son to take to school, but he carries it like a suitcase now! It\'s also really good for airplane travel.','Kennith',NULL),(9,9,1,'awesome for going back and forth','This is awesome for going back and forth to class. I live off campus and it\'s a longer walk, but this pack fits comfortably and I can even store my laptop in the main compartment.','Gaston',NULL),(10,10,1,'comfy and i don\'t feel like a loser','comfy and i don\'t feel like a loser carrying it.','Issac',NULL),(11,11,1,'The shoulder strap broke ','The shoulder strap broke the first time I used it. Awesome.','Daren',NULL),(12,12,1,'Good for work. Holds everything ','This is good for work. Holds everything I need. The fabric doesn\'t seem that strong, but so far so good.','Garry',NULL),(13,13,1,'Great bag! I use it for everything! ','Great bag! I use it for everything! Not sure what happened with the person who said the strap broke because mine is perfect. Maybe it was fluke? I\'d return it and try another. It\'s been awesome for me!','Quinn',NULL),(14,14,1,'This bag is really cool','This bag is really cool. I\'m an art major, so I have tons of supplies that I have to lug back and forth every day for class. I didn\'t think this would be big enough, but surprisingly it can hold just about all my stuff. I really like the way it looks too.','Jame',NULL),(15,15,1,'Color is weird','I wanted to like this bag, and it is definitely good quality, but the color is so weird in real life. From a distance it kind of looks like I just found it in a dumpster. Shame because that is the only drawback.','Adalberto',NULL),(16,16,1,'I am OBSESSED with these','I run 5 times a day and am OBSESSED with this watch! It tracks and calculates all the things my brain can\'t because I hate maths. PS I know this is a men\'s watch and I am not a man, but I have large wrists!','Refugio',NULL),(17,17,1,'This thing is awesome ','This thing is awesome and remembers all the stuff I\'ve stored. ','Jewel',NULL),(18,18,1,'It slides around on my wrist','It slides around on my wrist when I sweat. I\'ve tried making it smaller but that doesn\'t seem to help.','Brice',NULL),(19,19,1,'Working flawlessly','I recently replace my 25 year old watch with this one, so it had high expectations to live up to. So far all the features are working flawlessly, I only hope it lasts as long as my old one.','Billy',NULL),(20,20,1,'offers a lot of technology','can\'t say this is the coolest looking watch I\'ve ever owned (it\'s no FAMOUS DESIGNER or anything) but it has a lot to offer technology-wise','Marc',NULL),(21,21,1,'Hydration alarm','This was given as a gift to me and it wasn\'t the one I asked for, but I\'m starting to like the different perks like the hydration alarm','Luther',NULL),(22,22,1,'It works ok but the ugliness is blinding','It works ok but the ugliness is blinding I am literally blinded','Leon',NULL),(23,23,1,'Watch too tight','Watch too tight please email how to loosen it or I\'ll leave bad review','Max',NULL),(24,24,1,'No ticktock','I got it because I thought it would still make a ticktick noise even though it\'s digital, but it doesn\'t!','Chuck',NULL),(25,25,1,'Not a bad watch for the price','Not a bad watch for the price. Wish it had actual numbers instead of marks, though.','Robert',NULL),(26,26,1,'the only watch I wear','Hands down, it\'s the only watch I wear when I\'m out on a run. The strap is soft and smooth, and the face even glows in the dark.','Noe',NULL),(27,27,1,'Dual time zone settings','When I\'m in another country, I hate not knowing what time it really is back home so the dual time zone settings are awesome!','Frank',NULL),(28,28,1,'Really perfect for travel ','Really perfect for my needs. I travel a ton, so I\'ll always know what time to give my wife a call back home.','Jamie',NULL),(29,29,1,'I really like the modern look','I really like the modern look of this watch, but I could only get one time zone to work. I hope it has a warranty because I\'m sending it back!','Bobby',NULL),(30,30,1,'This watch is so tight','This watch is so tight around my wrist! I don\'t care if it\'s adjustable, it cuts off my circulation.','Tommie',NULL),(31,31,1,'My favorite layers','This is one of my favorite layers for running in the winter, it keeps me warm but it\'s not super bulky.','Markus',NULL),(32,32,1,'Weird looking pocket','I where it when I\'m coaching football so I can run up and down the sidelines and yell without getting to hot. The pocket on the chest is weird looking tho.','Xavier',NULL),(33,33,1,'Perfect layer for the game','Perfect layer for wearing to the game, it doesn\'t shed all over your clothes like a regular hoodie.','Mike',NULL),(34,34,1,'The fabric is great','the fabric is great, it keeps me warm but it\'s not bulky like my other hoodies. Runs large, though.','Emory',NULL),(35,35,1,'This jacket isn\'t keeping me warm','This jacket isn\'t keeping me warm','Jon',NULL),(36,36,1,'I don\'t feel protected','Not sure exactly what \"elements\" they\'re talking about here. I don\'t feel protected from any \"elements\" in this throw-away.','Homer',NULL),(37,37,1,'avid hiker/snowboarder','I\'m an avid hiker/snowboarder and know quality when I see it. Please don\'t be fooled by the thin feel of this jacket - I always feel very comfortable and only rarely feel too warm, and then it\'s only because I wear insulating base layers. You will not be disappointed, especially if you\'re into winter sports or outdoor activities at higher elevations. My only issue with it is the zipper, which broke and had to be replaced.','Wilbur',NULL),(38,38,1,'Has never let me down','This jacket is going to be by my side for the rest of my life. It\'s never let me down once in a rainstorm, always keeping me dry as I bike back and forth to work. ','Long',NULL),(39,39,1,'Practically perferct','I have to say this is a practically perfect rain jacket. I do wish it was heavier though since it only works for me in spring and summer rainstorms. ','Lindsay',NULL),(40,40,1,'Excellent quality. I actually love','Excellent quality. I actually love when it rains because I get a lot of compliments whenever I wear this jacket. ','Randell',NULL),(41,41,1,'I just live for this track jacket','I just live for this track jacket. Because it\'s solid, I can put it on over any t-shirt and look really athletic. I may not exercise all the time, but wearing this jacket makes other people think I do!','Wyatt',NULL),(42,42,1,'Not 100% sure how I feel','Not 100% sure how I feel about this yet so I\'m going to number it right in the middle. It keeps me warm but the fleece is kind of itchy. It definitely has to go on top of another layer or you\'ll spend all day itching!','Glen',NULL),(43,43,1,'fleece lining','The fleece lining is what sold me! I hate being cold and this jacket really helps me not to be. Almost perfect-the hem slightly unraveled which is preventing me from giving it a 5.','Shon',NULL),(44,44,1,'I didn\'t think it was that warm','I didn\'t think it was that warm at all and it needs a hood. I wouldn\'t wear it in the winter that\'s for sure. ','Neal',NULL),(45,45,1,'for my son to wear to school ','I got this for my son to wear to school and it\'s treated him very well. Not too bulky and the reversible design is a very nice touch!','Herschel',NULL),(46,46,1,'Kinda bulky','Kinda bulky when you wear both, but they still let me move ok. Great for football games.','Rudolf',NULL),(47,47,1,'easy to take apart','I like this one. It\'s easy to take apart when you want to wear the quilted part and zips back in no problem. If you\'re a big guy its fits a little tight under the arms though.','Emmett',NULL),(48,48,1,'does everything it\'s suppose','This jacket does everything it\'s supposed to do. Keeps me warm and has lots of room for my stuff. Good buy!','Burl',NULL),(49,49,1,'Love it; don\'t have to take off gloves','Love it; don\'t have to take my gloves off and dig around in my pocket for my ipod','Carol',NULL),(50,50,1,'Wish buttons were on sleeve','Wish the buttons were on the sleeve but still very cool. Jacket is way warm too','Ronald',NULL),(51,51,1,'Great on my evening ride','I went back to the site and snagged another in a different color - they\'re great on my evening rides. I usually prefer raglan sleeves but I am always comfortable in this design, and the mesh works wonders for keeping my temperature down. ','Arden',NULL),(52,52,1,'Loop thing broke','I\'d give it 4 or 5 stars if it wasn\'t for the fact that the effing  loop thing broke. It wasn\'t stretchy enough and now im back to carrying my fone and sweating on it ughghg! ','Jessie',NULL),(53,53,1,'They chafed me!','They chafed me!','Rashad',NULL),(54,54,1,'They are comfy','Don\'t know why people on here are so negative about these pants. They are comfy and feel very lightweight and soft. The internal pocket is great for cash when I need to refeul during runs! ','Barrett',NULL),(55,55,1,'Saggy pants','After running in these saggy pants I just wanted to crawl into a hole a die. ','Davis',NULL),(56,56,1,'These are really bulky','These are really bulky and not very flattering at all. It looks like I have a big bulge at my stomach. I wear them around the house but I wouldn\'t go out in public with them on.','Donte',NULL),(57,57,1,'Inseam is WAY too long','Either I\'m too short or this inseam is way off. WAY too long! I trip constantly in these.','Reyes',NULL),(58,58,1,'Keeping me warm before games','They do the job of keeping me warm before a game. I wear them then and only then-wouldn\'t wear them anywhere else.','Harold',NULL),(59,59,1,'There\'s nothing to dislike','There\'s nothing to dislike about these track pants bc they do everything you want??blocks the wind and keeps you warm. Very happy I got them!','Darius',NULL),(60,60,1,'The mesh lining sometimes snags','The mesh lining sometimes snags when your taking them off but that\'s pretty common I think. Like them and would recommend.','Armando',NULL),(61,61,1,'These are great!','These are great! Major major points for the two-tone design plus all those technologies - I never feel gross after my runs. A must have for anyone serious about their body! ','Hershel',NULL),(62,62,1,'I bought these for my man.','I bought these for my man. What can I say, these pants keep him comfortable and dry. Never heard any complaints except that he wishes they stretched more. Good buy! ','Hans',NULL),(63,63,1,'I like them','I like them, they keep my sweat on the down low. They are stretchy. And I like the pockets. They look cool, too. So yeah. Go buy them.','Kenny',NULL),(64,64,1,'THESE PANTS KEEP ME WARM','THESE PANTS KEEP ME WARM WHEN IM BENCHED AT MY GAME! I DON\'T GET TO PLAY A LOT. LOL','Nicky',NULL),(65,65,1,'Good dog walking pants','Good dog walking pants','Mark',NULL),(66,66,1,'The draw string is more like half a draw','The draw string is more like half a draw string. Dosent stay so pants fall of my butt. I think they run too big.','Margarito',NULL),(67,67,1,'I got this for running','I got this for running, but the fit is kind of funny so I just end up wearing it for yard work. It\'s light enough, just nothing special.','Tyree',NULL),(68,68,1,'Nice and light. ','Nice and light. I like that there\'s no obnoxious design.','Weston',NULL),(69,69,1,'I bought 5 of the same color!','People at the gym probably think I don\'t wwas my cloths because I wear this evryday but I just bought 5 of the same color because it\'s awesome!','Jude',NULL),(70,70,1,'my new favorite CrossFit shirt','Fits great. It\'s my new favorite CrossFit shirt.','Leigh',NULL),(71,71,1,'Works for the gym','Works for the gym and even as an undershirt.','Roland',NULL),(72,72,1,'I like the crew neck','I got this shirt in the v-neck version too and I like the crew a lot better. It seems to fit better and I think the fabric is lighter. This one doesn\'t have the mesh inserts but allover the fabric feels better.','Edison',NULL),(73,73,1,'Hate the fabric','Why is this kind of fabric all the rage? I know it\'s supposed to be the best thing since sliced bread with the moisture wicking crap but I feel like I sweat MORE than with just regular cotton. I\'m over paying an arm and a leg for the \"technology.\" give me a 5 dollar tshirt from the dollar store!','Hai',NULL),(74,74,1,'Ready to hit the gym','As soon as I put this shirt on I feel ready to hit the gym, even on my laziest days. Something about the way it feels just gets me psyched up!','Cletus',NULL),(75,75,1,'Too small ','I\'m a bodybuilder with extremely large, buff muscles and this shirt simply does not accommodate my bulk. Even with the V neck it\'s too tight around my neck, and the sleeve openings were practically cutting off circulation to my biceps and triceps! I had to send it back but I have to admit that felt good ;)','Gustavo',NULL),(76,76,1,'it says moisturewicking?','it says moisturewicking but i still sweat when i wear this shirt, don\'t trust what you read on the internet','Filiberto',NULL),(77,77,1,'This shirt is a dream come true','This shirt is a dream come true for a sweat bucket like me. Love the material and I don\'t look like I got stuck in the rain when I\'m done working out.','Nathan',NULL),(78,78,1,'Awesome tee! Not cheap.','Awesome tee! Not the cheapest though.','Darwin',NULL),(79,79,1,'Liked the way it fit mostly','Liked the way it fit mostly. But the collar was weird. I guess it kept me dry?','Jonas',NULL),(80,80,1,'Keeps me cool','I like this shirt, it keeps me cool when I\'m lifting. Would like a tighter fit though.','Warren',NULL),(81,81,1,'Gets the job done. Even when I\'m pouring','Gets the job done. Even when I\'m pouring sweat, this shirt maintains a nice dry feel. I think the sizing runs a little large, so order accordingly.','Jerome',NULL),(82,82,1,'I sweat SO much.','I sweat SO much. This top is fine when I don\'t intend to exert myself, but BOY does it NOT work for people with hyperhydrosis!','Alfonzo',NULL),(83,83,1,'This shirt is too tight and too thin.','This shirt is too tight and too thin. REALLY emphasizes the fact that I do not have clearly defined pectorals.','Sergio',NULL),(84,84,1,'Great training top. ','Great training top. I like that it also has UV protection because I\'m outdoors all the time. Seems are a little weird tho.','Donnell',NULL),(85,85,1,'I love this shirt. Perfect fit','I love this shirt. Perfect fit, perfect price. My dad plays on a softball team and I got one for him and he is very happy too. has my vote! ','Erwin',NULL),(86,86,1,'Comfortable and soft','On the plus side, it\'s definitely comfortble and soft,  and yes it does keep you dry  no matter how much you sweat. However, I found the cuffs to be too tight and the material is a little too sheer for my tastes. But it\'s not the most expensive on the shelf, so whatever.','Don',NULL),(87,87,1,'It\'s okay, a little boring. ','It\'s okay, a little boring. ','Maynard',NULL),(88,88,1,'Very comfy but wears thin','It is very comfy but wears thin - I won\'t be able to get much more use out it as it now is revealing my bra I think. I have the white one so I will switch to a darker color if I decide to by another 1. Very embarrassing when your at the gym. ','Hiram',NULL),(89,89,1,'I\'ve lost 50 pounds in 5 months','I\'ve lost 50 pounds in 5 months and this shirt kept me comfortable since day one. I would recommend it to anyone serious about workout. Sizes run small tho so order a size up. ','Darwin',NULL),(90,90,1,'Fell apart in wash','I don\'t even know where to begin. It fell apart during the third wash. Whoever says this is a good-quality piece of gear is lying through their teeth! ','Chung',NULL),(91,91,1,'Fantastic shirt for the price!','This is a fantastic shirt for the price!','Jae',NULL),(92,92,1,'Luma got it right with this one.','Luma got it right with this one. I don\'t care about looking stylish, I just want a shirt that will still feel good after an hour at the gym, and that\'s what I got.','Alfred',NULL),(93,93,1,'Ripped the FIRST TIME I wore ','This shirt ripped the FIRST TIME I wore it.','Carlo',NULL),(94,94,1,'Really comfy shirt','Really comfy shirt, sometimes clings a bit but at least it dries fast.','Gus',NULL),(95,95,1,'I work out a lot','I work out a lot and my shoulders are really big, most tank tops are too tight in the armholes but this one is great.','Harry',NULL),(96,96,1,'Nice fit and fabric','Nice fit and fabric, but the inserts are in weird places.','Damon',NULL),(97,97,1,'I purchased this tank top for my son','I purchased this tank top for my son when he\'s working out in the gym after school. It fits great and he loves it!','Duncan',NULL),(98,98,1,'Yea. This pilled imeddiately','Yea. This pilled imeddiately after I washed it. Definatly returning.','Wendell',NULL),(99,99,1,'Why can\'t you make this in my size?','Why can\'t you make this in my size? Thank you for the color at least. ','Harold',NULL),(100,100,1,'Wear this on evening runs','Wear this on evening runs. I absolutely adore it and will probably buy more.','Kasey',NULL),(101,101,1,'Great for baoting ','We go boating a lot and these are great for when I\'m putting our boat in the water. Those tiny rocks and pebbles can be super sharp but I never feel a single one of them. ','Manual',NULL),(102,102,1,'These do drain well','These do drain well and are really comfortable but the bottoms can still be slippery if you\'re walking on wet rocks. Just be careful!','Milton',NULL),(103,103,1,'They work great in water','They work great in water but I also like to wear em on hotter days if we\'re walking around and regular sandals will let too much debris get in.','Antwan',NULL),(104,104,1,'The only things I care about when I\'m ru','The only things I care about when I\'m running are comfort and speed. These are definitely comfortable but I don\'t think their lightweight enough to give me great speed. And the search continues.','Lamont',NULL),(105,105,1,'Great! I wear these almost every day-esp','Great! I wear these almost every day-especially love that I don\'t have to worry about the laces.','Gerald',NULL),(106,106,1,'These sit in my foyer waiting for my eve','These sit in my foyer waiting for my everyday run. Sometimes I run 5 miles in them, sometimes 10. They never let me down.','Ike',NULL),(107,107,1,'Running in these are imPOSSible!! I only','Running in these are imPOSSible!! I only can run 23 minutes at a time, but these hurt when I even do that. They look pretty snazzy though, lots of compliments from the ladies on my route.','Hugh',NULL),(108,108,1,'Pretty average cts. Their comfrtable whe','Pretty average cts. Their comfrtable when I first start but don\'t try working out too hard in them. You\'re feet will definitely start to hurt!','Judson',NULL),(109,109,1,'I wear these to my gym daily. I go hard ','I wear these to my gym daily. I go hard on the treadmill and these don\'t let me down.','Carlo',NULL),(110,110,1,'Love, love, love - did I say love? It wa','Love, love, love - did I say love? It was totally worth it to wait for Luma to come out with a trail running shoe. Very comfortable.','Jerold',NULL),(111,111,1,'I slipped on a rock on these shoes and I','I slipped on a rock on these shoes and I could feel all the pain. I would go out running on a regular day in these but not if it\'s been previously raining.','Ezra',NULL),(112,112,1,'The only thing I don\'t like about these ','The only thing I don\'t like about these shoes are the weird toes. They point upward making it look really strange on a guy. Otherwise very good.','Simon',NULL),(113,113,1,'These are really good to play tennis in ','These are really good to play tennis in too. They fit a little narrow in the heel which was fine for me but might be a problem for others.','Noah',NULL),(114,114,1,'I wore these until they finally gave out','I wore these until they finally gave out! Great running shoes..very comfortable and light and I could feel the difference the Torsion system makes. Highly recommended for anyone going out 4 to 5 times a week.','Joey',NULL),(115,115,1,'How awesome is it to find a product that','How awesome is it to find a product that works exactly as advertised! These seriously felt like I\'d been wearing them forever, the first time I put them on. The way it molds to your foot is amazing. I have run two full marathons in these with barely a blister. GO LUMA!','King',NULL),(116,116,1,'I wouldn\'t be a runner if it wasn\'t for ','I wouldn\'t be a runner if it wasn\'t for these shoes. I used to get really bad shin splints, blisters and pulled muscles no matter how much I stretched. Once I bought these it got so much eaiser. It is true that they are not that stylish but if you are serious about running, who cares?','Irwin',NULL),(117,117,1,'I wear these for a variety of sports and','I wear these for a variety of sports and they are very comfortable, no complaints there. I\'m not crazy about the design though. In person they look kind of feminine. Plus the color is no bueno. They somehow looked dirty and old even fresh out of the box.','Monroe',NULL),(118,118,1,'Awesome shoes!! I didn\'t realize how muc','Awesome shoes!! I didn\'t realize how much I\'d been missing by wearing other shoes without a lot of heel cushioning. I\'m sticking with these from now on.','Josh',NULL),(119,119,1,'They ran too narrow for me and the mater','They ran too narrow for me and the material was almost too light - seemed pretty flimsy and I don\'t think they would last very long.','Leslie',NULL),(120,120,1,'These are really REALLY LIGHT! Not much ','These are really REALLY LIGHT! Not much shoe or cushioning. My calves were sore after running in them 5 miles the first time.','Jody',NULL),(121,121,1,'Not great on slippery grass. I wear them','Not great on slippery grass. I wear them mostly for walking around.','Chad',NULL),(122,122,1,'I used these as racing flats and they we','I used these as racing flats and they were awesome. ','Anibal',NULL),(123,123,1,'Unflattering','Honestly, could this be any more unflattering? The cut is really bad and I can\'t see anyone looking good in this unless they\'re really muscular.','Dominic',NULL),(124,124,1,'Keeps me comfortable','I\'ve only worn it a few times so far, but it really keeps me comfortable at the gym. I throw on a pair of athletic shorts and call it a day.','Mervin',NULL),(125,125,1,'Nothing to write home about','I agree with the reviewer above. You can get this same tank in a million other stores, nothing to write home about. Do like the top stitching though-really adds some athleticsm.','Trey',NULL),(126,126,1,'Average tank','It\'s just an average tank. Nothing really to say about it. I rarely work out so I can\'t speak to the moisture-wicking part.','Edmund',NULL),(127,127,1,'NOT for skinny dudes ','Unless ur really muscular this won\'t look good. I\'m keeping it cuz it\'s motivation to keep working out. But skinny dudes be warned.','Tracey',NULL),(128,128,1,'Keeps me feeling dry','The fabric is great when I\'m sweating hard. It keeps me feeling dry. Wish there was more ventilation.','Archie',NULL),(129,129,1,'I feel awesome when I wear this','I feel awesome when I wear this to hit the gym!!!  The cut makes my triceps look huge. It\'s so rewarding to look in the mirror after a really tough workout. My girlfriend says I look like a lunkhead but I know she loves it!!','Eldon',NULL),(130,130,1,'Comfortable','Not as lightweight as it seems but it was ok. Comfortable.','Joey',NULL),(131,131,1,'I bought a few of these for my husband. ','I bought a few of these for my husband. He likes them but they did shrink when washed. I just don\'t put them in the dryer anymore and it\'s fine!','Matthew',NULL),(132,132,1,'TINY neck hole??','Why is the neck opening so small??? Didn\'t fit right.','Monroe',NULL),(133,133,1,'Shirt can stink after','Ok, MAYBE this is just me but I sweat a LOT when I run, and I\'ve noticed that this shirt really retains odor.  I washed it three times and it still stank so I had to just throw it away. Which sucks because I really liked it, but come on!','Scotty',NULL),(134,134,1,'Wish it was longer','wish it was longer. i\'m 5\'11 with a long torso and it\'s too short.','Alexander',NULL),(135,135,1,'Razorback version?','I\'d prefer if it was Racerback, but otherwise it\'s a great shirt. The Mesh zones are where you need them when you really get Sweaty.','Graham',NULL),(136,136,1,'Fits true to size, feels great.','Fits true to size, feels great. I bought three and I won\'t wear anything else when I\'m training.','Patrick',NULL),(137,137,1,'I bought this bag for my daughter','I bought this bag for my daughter because she travels all the time and she loves it! It\'s easy for her to roll and carry by herself even when full. ','Shella',NULL),(138,138,1,'Goes everywhere with me','I\'ve taken this bag to so many places and everything still works. I hate when the threads start to come apart and the zipper gets caught after like 2 uses. So far so good!','Crissy',NULL),(139,139,1,'The material is a little thin','The material is a little thin so I\'m afraid it won\'t last long. The zippers slide really nice and the wheels are good on the pavement. Overall a good purchase.','Alene',NULL),(140,140,1,'OBSESSED with this!','OBSESSED with this! I love that it\'s adjustable! A bit more expensive than I wanted, but TOTALLY worth it.','Cliff',NULL),(141,141,1,'Great but pricey','This totally makes me feel like I\'m actually working my muscles. The adjustable thing is awesome. A bit pricey though.','Fiona',NULL),(142,142,1,'I hate working out...This does not help.','I hate working out...This does not help.it gets tangled really easily.can\'t even get threw 1 work out with it. Returning.','Ardith',NULL),(143,143,1,'Want more resistance','Its great to be able to work out at home and sometimes on my lunch break at work - I wish this provided more resistance, though.','Randy',NULL),(144,144,1,'Agreed. More resistance','Agreed. I can do plenty of exercises with it and its awesome for when I can\'t make it to the gym, but I\'d like more resistance, too.','Keren',NULL),(145,145,1,'Too lazy to go to gym','I use these when I\'m too lazy to go to the gym. Really helps me stay in shape. I have already adjusted several times to increase the tension because I\'m getting stronger!','Madeleine',NULL),(146,146,1,'Do not buy!','Tried to adjust one and the plastic part just snapped in half. Very Disappointed. Do not buy!','Ricky',NULL),(147,147,1,'They work, nothing