e park. ','Adele',NULL),(293,293,1,'Velcro straps?? Are you kidding me? Am I','Velcro straps?? Are you kidding me? Am I two years old? The bottom is cool though!','Star',NULL),(294,294,1,'Cool-looking kicks! I\'d wear them anywhe','Cool-looking kicks! I\'d wear them anywhere not just the gym or running. They\'ll look great with everything!','Nikki',NULL),(295,295,1,'I absolutely love these trainers. I can ','I absolutely love these trainers. I can get on the gym floor so quick becuz i don\'t have to tie any annoying ties.','Rosy',NULL),(296,296,1,'Don\'t like the strap on top; gets too lo','Don\'t like the strap on top; gets too loose sometimes','Aleen',NULL),(297,297,1,'Love the no laces and they feel really g','Love the no laces and they feel really good- wear em all the time!','Dannette',NULL),(298,298,1,'I love these for when I walk the boardwa','I love these for when I walk the boardwalk with my grandaughter. They seem pretty hip and I got lots of compliments on them from the ladies at the bingo night','Lita',NULL),(299,299,1,'These looked really ugly on my feet when','These looked really ugly on my feet when I got them. The picture online is much more flattering than the reality. I\'m bummed. ','Joyce',NULL),(300,300,1,'I can appreciate the concept, but I thin','I can appreciate the concept, but I think I\'ll be going back to regular laced sneakers from now on, they just didn\'t seem to fit my feet as well I guess because my feet are so narrow. People with narrow feet shouldn\'t buy these!','Gertrud',NULL),(301,301,1,'I couldn\'t live without these. I wear th','I couldn\'t live without these. I wear them everywhere, not just running. They feel like I don\'t have anything on my feet, and their so, so comfortble.','Leonia',NULL),(302,302,1,'These are really well made and so lightw','These are really well made and so lightweight. I\'ll definitely be buying more of these.','Nadene',NULL),(303,303,1,'Want these in every single color Luma ma','Want these in every single color Luma makes! I am the first to say that I\'m a couch potatoe, I don\'t run at all. I wear these to the mall for shopping instead. :)','Min',NULL),(304,304,1,'Ummm, fashion? If you say so. They\'re co','Ummm, fashion? If you say so. They\'re comfy and all, but these shoes are hideous.','Katy',NULL),(305,305,1,'Cute and comfortable definitely. The ela','Cute and comfortable definitely. The elastic streteched out a bit too much but I still wear them.','Laurice',NULL),(306,306,1,'Love love LOVE!!!  I can\'t get enough of ','Love love LOVE!!!  I can\'t get enough of these shoes. They are SUPER comfy and go with everything!','Kara',NULL),(307,307,1,'It was really hard to find the right siz','It was really hard to find the right size for these. I had to send them back 3 times before I got a pair that fit. Really aggravating!!!  I ended up having to get two sizes larger than I usually wear and a wide, which I\'ve never worn before in my life. Sizing is messed up do yourself a favor, go to the store and try them on.','Angeline',NULL),(308,308,1,'VERY LIGHTWEIGHT COMFY-GOOD SHOES','VERY LIGHTWEIGHT COMFY-GOOD SHOES','Marita',NULL),(309,309,1,'Wore these for a year and they started f','Wore these for a year and they started falling apart. For the price I guess I\'ll just get another pair cuz I do like them. But I think a shoe should last longer. It\'s not like I can take my sneakers to a cobbler haha','Pura',NULL),(310,310,1,'I am in love with these shoes and will b','I am in love with these shoes and will buy them until they don\'t make them anymore. I run every day in them and I\'m still on my first pair after a whole year. They\'re SO comfy.','Natashia',NULL),(311,311,1,'Design is adorable-when you have cute wo','Design is adorable-when you have cute workout gear, exercising is fun. I\'d buy these again.','Brigitte',NULL),(312,312,1,'Have no idea what all the fuss is about ','Have no idea what all the fuss is about with these. I don\'t know, maybe I just bought the wrong size, but these are so uncomfortable. They dig into my toes and I always end up with blisters. Their cute but will look elsewhere.','Roseline',NULL),(313,313,1,'Pic is WAY different then the real thing','Pic is WAY different then the real thing! My mom wouldn\'t even wear these there so ugly! Can I give a 0 rating?','Garnett',NULL),(314,314,1,'Meh, I\'m not hating them, but I\'m not in','Meh, I\'m not hating them, but I\'m not in love. The eyelet part looks way different online and the elastic band felt really tight. They are pretty comfy other than that.','Eugena',NULL),(315,315,1,'I\'m a mom on the go and I love these sho','I\'m a mom on the go and I love these shoes! They\'re comfy, cute and easy to slip on. What more could you ask for?','Elina',NULL),(316,316,1,'Not exactly true to size','Not exactly true to size but still very comfortable. ','Mistie',NULL),(317,317,1,'Snug fit without being too tight','Snug fit without being too tight and no irritation or chafing. ','Ming',NULL),(318,318,1,'bra stays comfy and dry','I play field hockey and it gets crazy hot outside - bra stays comfy and pretty dry. Recommended!','Mei',NULL),(319,319,1,'One of my favorites b/c no chafing!','One of my favorites b/c no chafing!','Bernetta',NULL),(320,320,1,'Doesn\'t fit me. Luma fail.','Doesn\'t fit me. Luma fail.','Roxie',NULL),(321,321,1,'does not fit. worthless.','does not fit. worthless.','Ardelia',NULL),(322,322,1,'So, so awesome. Great Support!','So, so awesome. Great Support! I just can\'t wait for the day that I\'m comfortable enough with my midriff to wear this sans shirt, because the pattern is really cute!!','Dorcas',NULL),(323,323,1,'I love this bra','I have a B cup and I love how this bra feels! It has a really firm fit but it doesn\'t feel too tight. I wish every bra felt like this!','Cayla',NULL),(324,324,1,'So comfortable','If I could wear this sports bra every day, I definitely would. It\'s so so comfortable and washes well.','Tonya',NULL),(325,325,1,'It\'s an average bra','It\'s an average bra-nothing to write home about. I don\'t like how the straps dig into my shoulders, and it really doesn\'t provide that much support.','Eartha',NULL),(326,326,1,'Make this with patterns','I wish they made this bra with patterns because I like to look good at the gym. This is a little blah, but still cute. I would never wear it by itself.','Jammie',NULL),(327,327,1,'Cute gym top','So, it doesn\'t say that theres no shelf bra. BEWARE! Other than that, cute gym top.','Lorena',NULL),(328,328,1,'Cute, stretchy top!','Cute, stretchy top! Perfect for people with zero body fat.','Modesta',NULL),(329,329,1,'I got every color','I am a compulsive hoarder of workout gear so of course I had to have this in every color. I feel better after I buy them all because it\'s a good price!','Ayanna',NULL),(330,330,1,'unflattering. Ugh.','unflattering. Ugh. The elastic was literaly digging into my skin. I got my exact size so I thought I\'d be good. All set.','Avelina',NULL),(331,331,1,'Training bra?','Makes me feel like I\'m wearing a training bra. Comfy though.','Maribel',NULL),(332,332,1,'Sizes are off','I had to order 3 sizes before I found my fit. The sizes do NOT line up. I did like it in the end. Just took too long to get there.','Krystina',NULL),(333,333,1,'Makes me feel so snug! WHOO! ','Makes me feel so snug! WHOO! ','Concepcion',NULL),(334,334,1,'Could be flirtier.','Could be flirtier.','Emerald',NULL),(335,335,1,'Not for non-petite','Watch out if you\'re shapely like me - this tiny thing makes it hard to breath! ','Teofila',NULL),(336,336,1,'one of my favorites','I do a lot of different exercises and this tank - I have 2 of them - is one of my favorites. It\'s really soft and stays drier than other tops I\'ve had.','Elza',NULL),(337,337,1,'Zero support/modesty','I would never wear this bra to anything but a low impact class like yoga. There\'s zero support and absolutely no modesty. Was hoping for better!','Shaunte',NULL),(338,338,1,'Not for high impact','Definitely not good for anything high-impact, but it\'s very stylish for yoga or something else low impact.','Merrie',NULL),(339,339,1,'A regular or me','This is in regular rotation at the gym. Its colorful and looks kinda cute under my exercise tanks.','Pearl',NULL),(340,340,1,'Great fit - love the v-neck design! ','Great fit - love the v-neck design! ','Thalia',NULL),(341,341,1,'The seams bother me','Some of the seams bother me during certain workouts but otherwise very comfortable','Carma',NULL),(342,342,1,'A sweet n sporty look for the gym','Always a sweet n sporty look for the gym! Keeps me cool and the seams don\'t rub up against me like some of my other tanks.','Maryanna',NULL),(343,343,1,'Good choice for working out','Good choice for working out and stylin\' enough to wear when I\'m hanging with friends on hot days. Also washes really well! ','Elfriede',NULL),(344,344,1,'I love the look','I love the look of this top, but I wasn\'t too crazy about the fit. The medium was too big in my opinion.','Yan',NULL),(345,345,1,'Huge arm holes??','I don\'t know why the arm holes are so big. It looked ok in the photo but in person they\'re really wide. It\'s really comfortable but that bugs me.','Valorie',NULL),(346,346,1,'Super cute!!!  I love it','Super cute!!!  I love it and want more colors. I really like running in this tank because it\'s not too tight.','Mikkel',NULL);
